import Todo from './Todo';

const TodoList = ({ list, setList }) => {
    console.log(list)
    return (
        <div>
            <ul className='tasks-list'>
                {list.map((task) => {
                    return <Todo text={task.text}
                        task={task}
                    />
                })}
            </ul>
        </div>
    )
}

export default TodoList;
